original_text:
Denn ich weiß, dass der Herr groß und unser Gott über alle Götter erhaben ist.
Alles, was er immer will, führt der Herr aus im Himmel, auf Erden, im Meere und in allen Tiefen;
der Wolken herbeiführt vom Ende der Erde her, Blitze zum Regen schafft, der die Winde aus seinen Schatzkammern hervorholt,
der die Erstgeburt Ägyptens schlug, Menschen wie Vieh;
der Zeichen und Wunder in deine Mitte sandte, Ägypten! wider Pharao und wider alle seine Knechte;
der viele Völker schlug und mächtige Könige tötete,
Sehon, den König der Amorrhiter, Og, den König von Basan, und alle Reiche Kanaans,
und ihr Land zum Erbe gab, zum Erbe seinem Volke Israel.
